full_text:
Why, after buying an item, do I see ads for similar ads for the same item? I already bought the flashlight I searched for and now you show me more of the same/similar flashlights I already decided not to buy.

Can you add a filter to never show me items made in China?
@amazon

@coolmcjazz Bill Clinton gutted in the middle class when he let China into the WTO.

We got a lot of cheap crap but lost millions of good paying (and often unionized) jobs.

Income inequality is the fault of both Democrats and Republicans. Corporate welfare and modern monetary theory.
